import React, { Component } from 'react';

const Portfolioitem = props => {
	return (
		<div
			className="portfolio-item"
			style={{ backgroundImage: url('./../ img /costam.jpg') }}
		>
			{props.name}
		</div>
	);
};

export default Portfolioitem;
